Conceptually, implementing list.push(i) should be straightforward: we create a new instance of our struct for list nodes that stores i in its elem field and the original list in its next field. We may thus be tempted to write the following: # #![feature(box_patterns)]
#use prusti_contracts::*;
#
#pub struct List {
# head: Link,
#}
#
#enum Link {
# Empty,
# More(Box<Node>),
#}
#
#struct Node {
# elem: i32,
# next: Link,
#}
#
impl List {
# #[pure]
# pub fn len(&self) -> usize {
# self.head.len()
# }
#
# #[ensures(result.len() == 0)]
# pub fn new() -> Self {
# List {
# head: Link::Empty,
# }
# }
# #[ensures(self.len() == old(self.len()) + 1)] pub fn push(&mut self, elem: i32) { let new_node = Box::new(Node { elem: elem, next: self.head, }); self.head = Link::More(new_node); }
}
#
#impl Link {
# #[pure]
# fn len(&self) -> usize {
# match self {
# Link::Empty => 0,
# Link::More(box node) => 1 + node.next.len(),
# }
# }
#} Unfortunately, the Rust compiler will complain about this attempt: [E0507] cannot move out of `self.head` which is behind a mutable reference. self is a mutable borrow, meaning once it expires ownership to the referenced data returns to the original owner. However, we moved parts of those, the original list, into our newly created node. This would leave the borrow in a partially initialized state when it expires and would not allow us to return ownership. Hence, the compiler raises an error. See 2.3: Ownership 101 and 2.4: Push in the Rust tutorial for details. A working alternative exploits that self is a mutable borrow which allows us to completely overwrite the referenced data. Instead of moving the original list into the new node, we swap it with an empty list that can be returned to the owner once the borrow expires. The Rust standard library provides the function std::mem::replace for that purpose - it moves its second argument into the referenced first argument and returns the originally referenced value. Using this function, the Rust compiler accepts the following implementation: # #![feature(box_patterns)]
#use prusti_contracts::*;
#
use std::mem; #pub struct List {
# head: Link,
#}
#
#enum Link {
# Empty,
# More(Box<Node>),
#}
#
#struct Node {
# elem: i32,
# next: Link,
#}
#
impl List {
# #[pure]
# pub fn len(&self) -> usize {
# self.head.len()
# }
#
# #[ensures(result.len() == 0)]
# pub fn new() -> Self {
# List {
# head: Link::Empty,
# }
# }
# #[ensures(self.len() == old(self.len()) + 1)] pub fn push(&mut self, elem: i32) { let new_node = Box::new(Node { elem: elem, next: mem::replace(&mut self.head, Link::Empty), }); self.head = Link::More(new_node); }
}
#
#impl Link {
# #[pure]
# fn len(&self) -> usize {
# match self {
# Link::Empty => 0,
# Link::More(box node) => 1 + node.next.len(),
# }
# }
#} In fact, the above implementation of push is correct. However, attempting to verify it with Prusti still yields a verification error: [Prusti: verification error] postcondition might not hold. This error may look surprising at first: We create a new list node that stores the the original list in its next field. Why is Prusti unable to realize that the length of the resulting list is one plus the length of the original list? The explanation is that Prusti performs function modular verification, that is, it only uses a function's specification (instead of also consulting the function's implementation) whenever it encounters a function call. The only exception are pure functions, such as len, where Prusti also takes the function body into account. In our case, the function std::mem::replace is neither marked as pure nor does it come with a specification. Hence, Prusti assumes that it is memory safe and nothing else. That is, Prusti uses true as both pre- and postcondition of std::mem::replace, which is too weak to prove the specification of push: according to its specification, std::mem::replace could arbitrarily change the original list and thus also its length. Hence, we cannot conclude that the length the list returned by mem::replace(&mut self.head, Link::Empty) coincides with the length of the original list. We can remedy this issue by strengthening the specification of std::mem::replace. In this tutorial, we will assume that the standard library is correct, that is, we do not attempt to verify specifications for functions in external crates, like std::mem::replace. To this end, we introduce a trusted wrapper function replace that calls std::mem::replace and is equipped with the desired specification. The attribute #[trusted] tells Prusti to assume the provided specification is correct without attempting to verify it against a function's body. After introducing a trusted wrapper that ensures that replace does not change the length of the original list, the foll