#
#pub struct List {
# head: Link,
#}
#
#enum Link {
# Empty,
# More(Box<Node>),
#}
#
#struct Node {
# elem: i32,
# next: Link,
#}
#
#[trusted]
#[ensures(old(dest.len()) == result.len())]
fn replace(dest: &mut Link, src: Link) -> Link { mem::replace(dest, src)
} impl List {
# #[pure]
# pub fn len(&self) -> usize {
# self.head.len()
# }
